import React, { useEffect, useState, useRef } from "react";
import axios from "axios";
import { API } from "config/Api";
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import MDAvatar from "components/MDAvatar";
import Icon from "@mui/material/Icon";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";

export default function Data() {
  const adminAccessToken = localStorage.getItem("Admin-Token");
  const [FilesList, SetFilesList] = useState([]);
  const [menu, setMenu] = useState(null);
  const downloadLink = useRef(null);

  const openMenu = ({ currentTarget }) => setMenu(currentTarget);
  const closeMenu = () => setMenu(null);

  const handleDownloadClick = (fileUrl) => {
    // Set the file URL and trigger the download
    downloadLink.current.href = fileUrl;
    downloadLink.current.click();
    closeMenu();
  };

  useEffect(() => {
    axios
      .get(API.BASE_URL + "csvfilehistory/", {
        headers: {
          Authorization: `Bearer ${adminAccessToken}`,
        },
      })
      .then((res) => {
        SetFilesList(res.data.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  const Filename = ({ image, name }) => (
    <MDBox display="flex" alignItems="center" lineHeight={1}>
      <MDAvatar src={image} name={name} size="sm" />
      <MDTypography variant="button" fontWeight="medium" ml={1} lineHeight={1}>
        {name}
      </MDTypography>
    </MDBox>
  );

  return {
    columns: [
      { Header: "File Name", accessor: "filetrain", width: "45%", align: "left" },
      { Header: "Trained", accessor: "trained", width: "10%", align: "left" },
      { Header: "Working", accessor: "working", align: "center" },
      { Header: "Action", accessor: "action", align: "center" },
    ],

    rows: FilesList.map((files) => ({
      filetrain: <Filename image={logoXD} name={files.csvname} />,
      trained: (
        <MDBox display="flex" py={1}>
          Yes
        </MDBox>
      ),
      working: (
        <MDTypography variant="caption" color="text" fontWeight="medium">
          Yes
        </MDTypography>
      ),
      action: (
        <MDTypography variant="caption" color="text" fontWeight="medium">
          <MDBox color="text" px={2}>
            <Icon sx={{ cursor: "pointer", fontWeight: "bold" }} fontSize="small" onClick={openMenu}>
              more_vert
            </Icon>
          </MDBox>
          <a ref={downloadLink} style={{ display: 'none' }} download={files.csvname} />
          <MenuItem onClick={() => handleDownloadClick(files.csvfile)}>Download</MenuItem>
        </MDTypography>
      ),
    })),
  };
}
